import { library } from '@fortawesome/fontawesome-svg-core'

function Tache({sendInfo}) {


    return <div className="Tache">
        <FontAwesomeIcon icon="check-square" />
        <FontAwesomeIcon icon="fa-solid fa-barcode" />
    </div>;
}
export default Tache;
